    private function createLocalisations(ObjectManager $manager, $localisations, &$min = 0, &$max = 0, $parent = null, $niveau = 0){
    	$toReturn = array();
    	foreach ($localisations as $localisation =>$enfants){
			$object = new Localisation();
	        $object->setNom($localisation);
	        $object->setMin($min);
	        $min++;
			$max++;
	        if(!is_null($parent)){
	        	$object->setParent($parent);
	        }
	        //$manager->persist($object);
	        $toReturn[$localisation] = array();
	        $toReturn[$localisation]['enfants'] =$this->createLocalisations($manager, $enfants, $min, $max, $object, $niveau + 1);
			$object->setMax($max);
			$object->setNiveau($niveau);
			$object->setPopulation(0);
	        $toReturn[$localisation]['contenu'] = $object;
	        $manager->persist($object);
			
		}
		return $toReturn;
    }

